from fasthtml.common import *
from dataclasses import dataclass
from datetime import date

db = database("cards.db")

@dataclass
class Card:
    front: str
    back: str
    next_review: date
    interval: int = 1
    id: int = None

cards = db.create(Card, pk="id")

app, rt = fast_app()

@rt("/")
def get():
    return RedirectResponse("/cards", status_code=303)

@rt("/cards")
def get():
    return Ul(*[Li(f"{c.front} - {c.back}") for c in cards()])

@rt("/cards/new")
def get():
    return Form(
        Input(name="front", placeholder="Front"),
        Input(name="back", placeholder="Back"),
        Button("Create"),
        method="post"
    )

@rt("/cards/new")
def post(front: str, back: str):
    cards.insert(Card(front=front, back=back, next_review=date.today(), interval=1))
    return RedirectResponse("/cards", status_code=303)

@rt("/cards/{id}/delete")
def post(id: int):
    cards.delete(id)
    return RedirectResponse("/cards", status_code=303)
```

