Done when: GET `/study` shows next due card (front only) or "No cards due"; POST `/study/{id}/reveal` shows card back with rating buttons; POST `/study/{id}/rate` applies SM-2 rating (Again=1, Hard=*1.2, Good=*2.0, Easy=*3.0), updates next_review, redirects to `/study`

SM-2 Algorithm:
- Again (0): interval = 1
- Hard (1): interval = interval * 1.2
- Good (2): interval = interval * 2.0
- Easy (3): interval = interval * 3.0
- After rating: next_review = today + interval days

